(292, 326, '136805923037665_1180991981952382', 'Honestly speaking , I had a very bad experience with Samsung Egypt. I just purchase a new Galaxy A-7 on the 25th of April 2016 and Just after 15 days the screen become black and not displaying anything. I went to the vendor that he sent me to the maintenance shop of Samsung "approved" . He inspect the mobile then he admit that the screen was not broken. One day after, i called Samsung customer services. The feedback that i got that the screen of the mobile was broken !!!! and i have to pay 900 Le to get my mobile ! This is really frustrating.. Anyway, let me tell you that from the 10th of May up to day my mobile still in the maintenance shop and whenever i call the customer services the answer that we record your complain and will back to you. \nThis is my experience with Samsung Egypt. Could you please advise what can i do as this is not fair.\nI would like just to add, that i''m Tunisian and i use to leave in France and i never had this issue before with Samsung in France you can guess the difference\nThis is the worst Co and i advise everyone to think twice before purchasing anything from Them.', '1463482578', '2016-06-07 13:54:25', '2016-06-07 13:54:25'),
