(1211, 326, '136805923037665_1134318556619725', 'Dear Team,\n\nI would like to raise a complaint against the customer service in Egypt. \nI have an issue with my fridge that I had for less than 2 years ago, keeping in mind that the warranty is for 10 years, however it went faulty due to a manufactureâs fault, the team in Egypt not to mention how rude they are, especially on the last call I had with them, they said that my fridge  can`t be exchange now,  due to the crisis in the country therefore I need to wait and I had been waiting for that to happen for a whole month now still I don`t see how this is relevant to me, whatever happens in the country, as well they always say that they will call me back to follow up on the case and they never did, I have to call each time to chase what`s happening which reflects how poor the customer service is, I asked to speak to a manager and the agent refused to do so, because as she said that the manager will tell me the exact same thing, which is my right either ways to speak to a manager if I`m not happy,\nI`m so disappointed by the level of the customer service you provided me, they made me change my mind about your products in total, still just to let you know I contacted the social media team and they said that they will call us, however no one did as usual, I`m shocked that a large company like you have such a customer service a very poor one I`m sorry to say such an awful service, keeping in mind that I lost a lot of money having to throw away a lot of food because of this, I have been waiting for the fridge to be exchange for over a month now, which  is not acceptable by all means, HELP!!\nI`m sure that you should take some actions about that, Just to let you know that I already posted this on the social media, there is a page called ( Eshtiki ). They will take it further on the social media ( Facebook, twitter, google plus etc. )', '1458141950', '2016-06-07 14:01:49', '2016-06-07 14:01:49'),
